import React, { useEffect, useState } from "react";
import { useAuth } from "./contexts/AuthContext";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
} from "@mui/material";

import Paper from "@mui/material/Paper";

export default function ManageUsers() {
  let rows = [];
  const {readUser,usrData, delUser} = useAuth()
console.log(usrData)
